import React from "react";
import axios from "axios";
export default function Index({ post }) {
  console.log(post);
  return (
    <div>
      <ul>
        {post.map((p) => (
          <li key={p.id}>
            {" "}
            <h5>p.title</h5>
            <p>p.body</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

Index.getInitialProps = async () => {
  const post = await axios.get("https://jsonplaceholder.typicode.com/posts");
  const { data } = post;
  return { post: data[0] };
};
